const LandingPage4 = () => {
  return (
    <div>
        <p>Ready to trade Buy/Sell cryptocurrencies in just 10 minutes?</p>
        <h1>Create your account for free and start trading today!</h1>
        <button>Get Started</button>
    </div>
  )
}

export default LandingPage4
